import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui inverted vertical menu">
  <a class="active item">
    Home
  </a>
  <a class="item">
    Messages
  </a>
  <a class="item">
    Friends
  </a>
</div>
    );
  }
}

export default Header;
